import React from 'react'
import { Container } from 'react-bootstrap'

import Button from 'react-bootstrap/Button'
import { useHistory } from 'react-router-dom'

export const ButtonResult = ({ param }) => {
  let history = useHistory()

  var personInfo = localStorage.getItem('currentUser')
  var UserData = JSON.parse(personInfo)
  //console.log(UserData)

  const newPage = (path) => {
    history.push({
      pathname: '/user/' + path + UserData?.id, // userId must be here
      state: { personId: UserData?.id }, // here too
    })
  }

  return (
    <>
      {param ? (
        <Container>
          <Button
            className='RentButton'
            variant='warning'
            onClick={(param) => {
              newPage(param + '/rent')
            }}
          >
            Rent
          </Button>

          <Button
            className='BookingButton'
            variant='warning'
            onClick={(param) => {
              newPage(param + '/selling')
            }}
          >
            Buy
          </Button>
        </Container>
      ) : null}
    </>
  )
}
